ops::range::RangeInclusive::<Idx>::is_em.doc:
Returns `true` if the range contains no items.

# Examples

```
assert!(!(3..=5).is_empty());
assert!(!(3..=3).is_empty());
assert!( (3..=2).is_empty());
```

The range is empty if either side is incomparable:

```
assert!(!(3.0..=5.0).is_empty());
assert!( (3.0..=f32::NAN).is_empty());
assert!( (f32::NAN..=5.0).is_empty());
```

This method returns `true` after iteration has finished:

```
let mut r = 3..=5;
for _ in r.by_ref() {}
// Precise field values are unspecified here
assert!(r.is_empty());
```

ops::try_trait::Try::from_output.doc:
Constructs the type from its `Output` type.

This should be implemented consistently with the `branch` method
such that applying the `?` operator will get back the original value:
`Try::from_output(x).branch() --> ControlFlow::Continue(x)`.

# Examples

```
#![feature(try_trait_v2)]
use std::ops::Try;

assert_eq!(<Result<_, String> as Try>::from_output(3), Ok(3));
assert_eq!(<Option<_> as Try>::from_output(4), Some(4));
assert_eq!(
    <std::ops::ControlFlow<String, _> as Try>::from_output(5),
    std::ops::ControlFlow::Continue(5),
);

# fn make_question_mark_work() -> Option<()> {
assert_eq!(Option::from_output(4)?, 4);
# None }
# make_question_mark_work();

// This is used, for example, on the accumulator in `try_fold`:
let r = std::iter::empty().try_fold(4, |_, ()| -> Option<_> { unreachable!() });
assert_eq!(r, Some(4));
```

cmp::PartialOrd::lt.doc:
Tests less than (for `self` and `other`) and is used by the `<` operator.

# Examples

```
assert_eq!(1.0 < 1.0, false);
assert_eq!(1.0 < 2.0, true);
assert_eq!(2.0 < 1.0, false);
```

clone::Clone::clone.doc:
Returns a duplicate of the value.

Note that what "duplicate" means varies by type:
- For most types, this creates a deep, independent copy
- For reference types like `&T`, this creates another reference to the same value
- For smart pointers like [`Arc`] or [`Rc`], this increments the reference count
  but still points to the same underlying data

[`Arc`]: ../../std/sync/struct.Arc.html
[`Rc`]: ../../std/rc/struct.Rc.html

# Examples

```
# #![allow(noop_method_call)]
let hello = "Hello"; // &str implements Clone

assert_eq!("Hello", hello.clone());
```

Example with a reference-counted type:

```
use std::sync::{Arc, Mutex};

let data = Arc::new(Mutex::new(vec![1, 2, 3]));
let data_clone = data.clone(); // Creates another Arc pointing to the same Mutex

{
    let mut lock = data.lock().unwrap();
    lock.push(4);
}

// Changes are visible through the clone because they share the same underlying data
assert_eq!(*data_clone.lock().unwrap(), vec![1, 2, 3, 4]);
```

mem::replace.doc:
Moves `src` into the referenced `dest`, returning the previous `dest` value.

Neither value is dropped.

* If you want to replace the values of two variables, see [`swap`].
* If you want to replace with a default value, see [`take`].

# Examples

A simple example:

```
use std::mem;

let mut v: Vec<i32> = vec![1, 2];

let old_v = mem::replace(&mut v, vec![3, 4, 5]);
assert_eq!(vec![1, 2], old_v);
assert_eq!(vec![3, 4, 5], v);
```

`replace` allows consumption of a struct field by replacing it with another value.
Without `replace` you can run into issues like these:

```compile_fail,E0507
struct Buffer<T> { buf: Vec<T> }

impl<T> Buffer<T> {
    fn replace_index(&mut self, i: usize, v: T) -> T {
        // error: cannot move out of dereference of `&mut`-pointer
        let t = self.buf[i];
        self.buf[i] = v;
        t
    }
}
```

Note that `T` does not necessarily implement [`Clone`], so we can't even clone `self.buf[i]` to
avoid the move. But `replace` can be used to disassociate the original value at that index from
`self`, allowing it to be returned:

```
# #![allow(dead_code)]
use std::mem;

# struct Buffer<T> { buf: Vec<T> }
impl<T> Buffer<T> {
    fn replace_index(&mut self, i: usize, v: T) -> T {
        mem::replace(&mut self.buf[i], v)
    }
}

let mut buffer = Buffer { buf: vec![0, 1] };
assert_eq!(buffer.buf[0], 0);

assert_eq!(buffer.replace_index(0, 2), 0);
assert_eq!(buffer.buf[0], 2);
```

ops::try_trait::Try::branch.doc:
Used in `?` to decide whether the operator should produce a value
(because this returned [`ControlFlow::Continue`])
or propagate a value back to the caller
(because this returned [`ControlFlow::Break`]).

# Examples

```
#![feature(try_trait_v2)]
use std::ops::{ControlFlow, Try};

assert_eq!(Ok::<_, String>(3).branch(), ControlFlow::Continue(3));
assert_eq!(Err::<String, _>(3).branch(), ControlFlow::Break(Err(3)));

assert_eq!(Some(3).branch(), ControlFlow::Continue(3));
assert_eq!(None::<String>.branch(), ControlFlow::Break(None));

assert_eq!(ControlFlow::<String, _>::Continue(3).branch(), ControlFlow::Continue(3));
assert_eq!(
    ControlFlow::<_, String>::Break(3).branch(),
    ControlFlow::Break(ControlFlow::Break(3)),
);
```

ops::try_trait::FromResidual::from_resid.doc:
Constructs the type from a compatible `Residual` type.

This should be implemented consistently with the `branch` method such
that applying the `?` operator will get back an equivalent residual:
`FromResidual::from_residual(r).branch() --> ControlFlow::Break(r)`.
(The residual is not mandated to be *identical* when interconversion is involved.)

# Examples

```
#![feature(try_trait_v2)]
use std::ops::{ControlFlow, FromResidual};

assert_eq!(Result::<String, i64>::from_residual(Err(3_u8)), Err(3));
assert_eq!(Option::<String>::from_residual(None), None);
assert_eq!(
    ControlFlow::<_, String>::from_residual(ControlFlow::Break(5)),
    ControlFlow::Break(5),
);
```

